import img_ico from '../../assets/ico/list_img_ico';
import './Footer.css';


const Icono = (image_index = 0, url) => {
    return(
        <li>
            <a href={url}>
                <img src={img_ico[image_index].img} alt={img_ico[image_index].alt}/>
            </a>
        </li>
    );
}


const Footer = () =>{
    return(
        <ul className='ico_list'>
            <Icono image_index={1} url={'/'}/>
            <li><a href='/'><img src={img_ico[1].img} alt={img_ico[1].alt}/></a></li>
            <li><a href='/'><img src={img_ico[2].img} alt={img_ico[2].alt}/></a></li>
            <li><a href='/'><img src={img_ico[3].img} alt={img_ico[3].alt}/></a></li>
            <li><a href='/'><img src={img_ico[4].img} alt={img_ico[4].alt}/></a></li>
            <li><a href='/'><img src={img_ico[5].img} alt={img_ico[5].alt}/></a></li>
        </ul>
    );
}

export default Footer;
